import { useState, useEffect, useRef } from "react";
// import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { SetSelectDom } from '../js/select.js';
import "./index.css";
// import "../../public/bootstrap.js";
import Nav from "./Common/Nav.js";
import Footer from "./Common/Footer.js";
import SearchResult from "../pages/SearchResult";
import SearchPage from "../pages/SearchPage";
import SearchDetail from "../pages/SearchDetail";

import { Router, Route, Link } from 'react-router'

const Home = () => {
  useEffect(() => { 
    SetSelectDom();
    const script = document.createElement("script");
    script.src = "../../public/bootstrap.js";
    script.async = true;
    document.body.appendChild(script);
  }, [])

  return (
    <div>
      <Router>
        <Nav/>
        <Switch>
          <Route path="/" component={Home}>
            <Route path="searchdetail" component={SearchDetail} />
            <Route path="searchpage" component={SearchPage} />
            <Route path="searchresult" component={SearchResult} />
          </Route>
        </Switch>
        <Footer/>
      </Router>
      {/* <Nav/> */}
      {/* {this.props.children} */}
      {/* <Header/>
      <Carousel/>
      <IntroList title="newactivity" type="AC"/>
      <IntroList title="hotPlace" type="PC"/>
      <IntroList title="goodFood" type="PC"/> */}
      {/* <Footer/> */}
    </div>
  );
};

export default Home;
